const Container = styled.View`
  flex: 1;
  align-items: center;
  justify-content: center;
  background-color: #F5F5F5;
`;

const Logo = styled.Image`
  height: 30%;
  margin-bottom: 40px;
`;

const Input = styled.TextInput`
  padding: 15px 20px;
  border-radius: 5px;
  background-color: #FFF;
  align-self: stretch;
  margin-bottom: 15px;
  margin: 0px 20px;
  font-size: 16px;
`;
